    return (
        <div className={s.postsBlock}>
            <h3>My post</h3>
            <div>
                <div>
                    <textarea>Text</textarea>
                </div>
                <div>
                    <button>Button</button>
                </div>
            </div>
            <div className={s.posts}>
                {postsElements}
                {/*// <Post message={postsData[1].post} likesCount={postsData[0].likeCount} />*/}
                {/*// <Post message='It is my first test!' likesCount='0' />*/}
                {/*// <Post message='What are you doing?' likesCount='777' />*/}
            </div>
        </div>
    )
}

